import React, { Component } from 'react';

class Footer extends Component {
  render() {
    return (
        <footer class="footer">
          <div>
            <p>
              
              cryptoviper
            </p>
            <Navbar class="navColor" brand='CryptoViper' right>
          <NavItem onClick={() => console.log('test click')}>Home</NavItem>
          <NavItem onClick={() => console.log('test click')}>Play</NavItem>
          <NavItem href='components.html'>Help</NavItem>
          <NavItem href='components.html'>Login</NavItem>
        </Navbar>
          </div>
        </footer>
    )
  }
}

export default Footer;
